import React from 'react';
import s from '../../App.module.scss';
import styles from './shop.module.scss'

const Shop = () => {
    return (
    <>
      <aside></aside>
      <div className={s.container}>
        <div className={styles.shop}>Shop</div>
      </div>
    </>
      
    )
}

export default Shop;
